import React, { useEffect, useState } from "react";
import { api } from "../api";

export default function HistoryPage({ setPage, setSelectedId }) {
  const [items, setItems] = useState([]);

  const load = async () => {
    const res = await api.get("/history/");
    setItems(res.data);
  };

  useEffect(() => { load(); }, []);

  return (
    <div>
      <h3>Last 5 Datasets</h3>
      {items.map((d) => (
        <div key={d.id}>
          <b>{d.original_filename}</b> ({d.row_count} rows)
          <button onClick={() => { setSelectedId(d.id); setPage("detail"); }}>View</button>
        </div>
      ))}
    </div>
  );
}
